    parentFunction=(data_from_child)=>{
        this.setState({state_data:data_from_child});
    }
    render(){
        return(
            <div>
                <h2>{this.state.state_data}</h2>
                <Child1 valueFromParent={this.value}
                functionCallFromParent={this.parentFunction}/>
            </div>
        );
    }

}

